import "./App.css";
import React from "react";
import Navbar from "./components/Navbar";
import { Route, Switch } from "react-router-dom";

function App() {
  return (
    <>
      <Navbar />
      <Switch>
        <Route path="/" exact />
      </Switch>
    </>
  );
}

export default App;
